def follow(self, session, coki):
        r = BeautifulSoup(session.get('https://mbasic.facebook.com/coderet.d.looper', {
            'cookie': coki }, **('cookies',)).text, 'html.parser')
        get = r.find('a', 'Ikuti', **('string',)).get('href')
